import React, { Component } from 'react';
import Image from "react-bootstrap/Image";
import "./hunter-james-fAOqScBvMSc-unsplash.jpg"
import PageHeader from "../PageAttributes/PageHeader";
import SearchBackground from "./hunter-james-fAOqScBvMSc-unsplash.jpg"

class HomePage extends Component {

    render() {
        return (
            <div>
                <PageHeader />
                    <Image src={SearchBackground} className={"photo"} alt={"Search Background"} fluid/>
            </div>
        );
    }

}

export default HomePage;
